  //   ctx.renderPage = () => {};

  //   const props = await Document.getInitialProps(ctx);
  //   return {
  //     ...props
  //   };
  // }

  render() {
    return (
      <Html>
        <Head>
          <title>My Own App</title>
          <style>{`.test {background-color:steelblue}`}</style>
        </Head>
        <body className="test">
          <Main />
          <NextScript />
        </body>
      </Html>
    );
  }
}

export default MyDocument;
